import './App.css';

import { Routes, Route } from 'react-router-dom';
import Home from './components/Home'
import Nav from './components/nav'

function App() {
  return (

    <Routes>
      <Route path='/' element={<Home />} />
      <Route path='/nav' element={<Nav />} />
    </Routes>

  );

}

export default App;
